script: |
  super -f text -I q12832.spq | sort > q12832.out

inputs:
  - name: q12832.spq
    data: |
      SELECT - ( - 69 ), ( - + col1 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 IS NULL;
  - name: tab2

outputs:
  - name: q12832.out
    data: |
      69	-51
      69	-67
      69	-77
